import { useState } from "react";
import {
  TextField,
  Button,
  InputAdornment,
  Icon,
  IconButton,
} from "@mui/material";
import { css } from "@emotion/css";

const Signup = () => {
  const [showPassword, setShowPassword] = useState(false);
  const handleShowPasswordClick = () => {
    setShowPassword(!showPassword);
  };

  return (
    <div
      className={css`
        position: relative;
        border-radius: var(--br-5xl);
        background-color: var(--white-color);
        width: 100%;
        height: 1080px;
        overflow: hidden;
        display: flex;
        flex-direction: row;
        align-items: center;
        justify-content: space-between;
        text-align: left;
        font-size: 50.05px;
        color: var(--white-color);
        font-family: var(--font-poppins);
      `}
    >
      <form
        className={css`
          position: relative;
          width: 597px;
          height: 979px;
        `}
      >
        <b
          className={css`
            position: absolute;
            top: -0.5px;
            left: 198px;
            font-size: 47.8px;
            text-transform: uppercase;
            display: inline-block;
            font-family: var(--font-poppins);
            color: var(--color-black);
            text-align: left;
            width: 382px;
            height: 113px;
          `}
        >
          Sign up
        </b>
        <div
          className={css`
            position: absolute;
            top: 59.06px;
            left: 86.03px;
            font-size: 25.49px;
            font-family: var(--font-poppins);
            color: var(--color-dimgray);
            text-align: left;
            display: inline-block;
            width: 369.63px;
            height: 38.31px;
          `}
        >
          Make An Account Right Away
        </div>
        <TextField
          className={css`
            border: none;
            background-color: transparent;
            position: absolute;
            top: 241.88px;
            left: 0px;
          `}
          sx={{ width: 579.9295654296875 }}
          color="secondary"
          variant="filled"
          type="text"
          label="Email-ID"
          placeholder="Placeholder"
          size="medium"
          margin="none"
          required
        />
        <TextField
          className={css`
            border: none;
            background-color: transparent;
            position: absolute;
            top: 138.5px;
            left: 0px;
          `}
          sx={{ width: 579.9295654296875 }}
          color="secondary"
          variant="filled"
          type="text"
          label="Full Name"
          placeholder="Placeholder"
          size="medium"
          margin="none"
          required
        />
        <TextField
          className={css`
            border: none;
            background-color: transparent;
            position: absolute;
            top: 345.54px;
            left: 0px;
          `}
          fullWidth
          color="secondary"
          variant="filled"
          type="text"
          label="Username"
          placeholder="Placeholder"
          size="medium"
          margin="none"
          required
        />
        <div
          className={css`
            position: absolute;
            top: 733.86px;
            left: 0px;
            width: 581.52px;
            display: flex;
            flex-direction: column;
            align-items: flex-start;
            justify-content: flex-end;
          `}
        >
          <div
            className={css`
              align-self: stretch;
              border-radius: 25.49px;
              border: 1.6px solid var(--color-lavender);
              box-sizing: border-box;
              height: 83.97px;
              display: flex;
              flex-direction: column;
              align-items: center;
              justify-content: center;
            `}
          >
            <div
              className={css`
                width: 229.42px;
                height: 48.44px;
                display: flex;
                flex-direction: row;
                align-items: center;
                justify-content: flex-start;
                gap: 12.75px;
              `}
            >
              <img
                className={css`
                  position: relative;
                  width: 47.8px;
                  height: 48.44px;
                  object-fit: cover;
                `}
                alt=""
                src="/google-1@2x.png"
              />
              <div
                className={css`
                  position: relative;
                  font-size: 19.12px;
                  color: var(--color-gray-200);
                  text-align: left;
                  display: inline-block;
                  width: 168.88px;
                  height: 29.06px;
                  flex-shrink: 0;
                `}
              >
                <span
                  className={css`
                    font-family: var(--font-poppins);
                  `}
                >{`Login with `}</span>
                <b
                  className={css`
                    font-family: var(--font-poppins);
                  `}
                >
                  google
                </b>
              </div>
            </div>
          </div>
          <div
            className={css`
              border-radius: 25.49px;
              border: 1.6px solid var(--color-lavender);
              box-sizing: border-box;
              width: 582px;
              height: 133px;
              display: flex;
              flex-direction: column;
              align-items: center;
              justify-content: center;
            `}
          >
            <div
              className={css`
                width: 258.1px;
                height: 49.73px;
                display: flex;
                flex-direction: row;
                align-items: center;
                justify-content: flex-start;
                gap: 12.75px;
              `}
            >
              <img
                className={css`
                  position: relative;
                  width: 47.8px;
                  height: 49.73px;
                  object-fit: cover;
                `}
                alt=""
                src="/facebook-1@2x.png"
              />
              <div
                className={css`
                  position: relative;
                  font-size: 19.12px;
                  color: var(--color-gray-200);
